  true,\n\t\"url\": null,\n\t\"notes\": \"This data set presents micrometeorological
  data from the Flux over Snow Surfaces (FLOSS) project carried out during the Cold
  Land Processes Field Experiment (CLPX) at North Park, Colorado, USA.  The project
  measured air temperature, air pressure, relative humidity, water vapor, cloud particles,
  carbon dioxide, longwave and shortwave radiation, and precipitation. Measurements
  were collected between November 2002 and March 2003. Sensors were installed on a
  Raytheon King Air 200T, which flew at low atlitude over the study area.\",\n\t\"license_title\":
